}

@media (max-width: 768px) {
  .navbar {
    background: rgba(0, 0, 0, 0.5);
  }
}


/* ---------- */


/* NAVIGATION */


/* ---------- */

.navbar {
  position: absolute;
  top: 0;
  width: 100%;
}


/* ----------- */


/* BLOG HEADER */


/* ----------- */


/* - Blog and post headers - */

#masthead {
  position: relative;
  display: table;
  text-align: center;
  width: 100%;
  height: 60vh;
  padding: 24px 0;
  margin-bottom: 72px;
  box-sizing: border-box;
}

#masthead.align-left {
  text-align: left;
}

#masthead.align-right {
  text-align: right;
}


/* - Brand - */

.brand img {
  max-height: 120px;
}


/* - Blog title and description - */

.blog-title {
  font-size: 36px;
  line-height: 36px;
  text-transform: uppercase;
  margin-bottom: 12px;
}

.blog-title span {
  display: block;
}

.blog-description {
  text-transform: none;
  padding-top: 12px;
  margin-top: 12px;
  font-size: 18px;
}

#main {
  position: relative;
  z-index: 1;
}

@media (max-width: 480px) {
  .brand img {
    max-height: 60px;
  }
  .blog-title {
    font-size: 24px;
    line-height: 24px;
  }
  .blog-description {
    display: none;
  }
}


/* ----------- */


/* POST STYLES */


/* ----------- */


/* - Post title - */

.post-title {
  margin-top: 0;
  margin-bottom: 12px;
  padding-bottom: 12px;
}


/* - Post info - */

.post-info {
  margin-bottom: 24px;
}


/* -- Post Tags -- */


/* -  Post Body - */

.post-body {
  padding-bottom: 72px;
  margin-bottom: 72px;
}

.post-template .post-body {
  padding-bottom: 36px;
  margin-bottom: 24px;
}

.post-body img {
  max-width: 100%;
  margin-bottom: 24px;
}

.post-body a {
  border-bottom: 1px dotted;
}


/* - Post Share - */

.post-share {
  margin-bottom: 48px;
}


/* - Post Author - */

.post-author {
  margin-bottom: 72px;
}

.post-author h4 {
  margin-top: 0;
  margin-bottom: 12px;
  padding-bottom: 12px;
}


/* - Post Avatar - */

.post-avatar {
  max-width: 72px;
  margin: 0 auto 12px;
}


/* -  Pagination - */

.pagination {
  display: block;
  position: relative;
}

.older-posts, .newer-posts {
  display: block;
  position: absolute;
  top: 0;
}

.older-posts {
  right: 0;
}

.newer-posts {
  left: 0;
}

@media (max-width: 480px) {
  .older-posts, .newer-posts {
    position: relative;
  }
}


/* ------ */


/* FOOTER */


/* ------ */

#footer {
  margin-top: 72px;
  padding: 124px 0 72px;
  position: relative;
  width: 100%;
  height: 60vh;
  display: table;
  z-index: 1;
}

#footer .container {
  position: relative;
  z-index: 2;
}


