/* THEME UTILITITES */


/* ---------------- */


/* - Decor -*/

.decor-wrapper {
  width: 100%;
  height: 50%;
  position: absolute;
  left: 0;
  bottom: 0;
}

#footer .decor-wrapper {
  bottom: auto;
  top: 0;
}

@media (max-width: 767px) {
  .decor-wrapper {
    max-height: 150px;
  }
}

@media (max-width: 480px) {
  .decor-wrapper {
    max-height: 100px;
  }
}

.decor {
  position: absolute;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 2;
}

.decor.bottom {
  bottom: -1px;
}

.decor.top {
  top: -1px;
}


/* - Theme Backgrounds - */

.blog-background {
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  background-attachment: fixed;
}

@media (max-width: 1024px) {
  .blog-background {
    background-attachment: scroll;
  }
}


/* - Inner allignment - */

.inner {
  display: table-cell;
  vertical-align: top;
  position: relative;
  z-index: 10;
}

.align-middle .inner {
  vertical-align: middle;
}

.align-bottom .inner {
  vertical-align: bottom;
}

@media (max-width: 767px) {
  #masthead .inner {
    top: 0%;
  }
}


/* - Overlay - */

.overlay:after {
  content: "";
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  z-index: 1;
}


/* - Border Classes - */

.bordered-top, .bordered-bottom {
  position: relative;
}

.bordered-top:after, .bordered-bottom:after {
  content: '';
  display: block;
  position: absolute;
  height: 1px;
  width: 80px;
  left: 50%;
  margin-left: -40px;
}

.bordered-top:after {
  top: 0;
}

.bordered-bottom:after {
  bottom: 0;
}


/* Social list */

.social-icons {
  margin: 0;
  padding: 0 0 48px;
  list-style-type: none;
}

.social-icons li {
  display: inline-block;
  padding: 0 12px;
}

.social-icons a {
  display: block;
  font-size: 24px;
  height: 72px;
  width: 72px;
  line-height: 72px;
  border-radius: 50%;
  -webkit-transition: all .2s;
  transition: all .2s;
}

.social-icons i {
  vertical-align: middle;
}

.social-mini {
  margin: 0;
  padding: 0 0 24px;
  list-style-type: none;
}

.social-mini li {
  display: inline-block;
  font-size: 16px;
  padding: 0 12px;
}


/* - Responsive videos -*/

.videoWrapper {
  position: relative;
  padding-bottom: 56.25%;
  /* 16:9 */
  padding-top: 25px;
  height: 0;
  margin-bottom: 24px;
}

.videoWrapper iframe {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}


/* ----------- */


/* THEME FONTS */


/* ----------- */

body {
  font-family: 'Merriweather', serif;
}

body input, body textarea, body .btn, body button {
  font-family: 'Merriweather', serif;
}

.lighter {
  font-weight: 200 !important;
}

.light {
  font-weight: 300 !important;
}

.lead {
  font-weight: 400;
}

h1, h2, h3, h4, h5, h6, .navbar {
  font-family: 'Source Sans Pro', sans-serif;
}

h1.lighter, h2.lighter, h3.lighter, h4.lighter, h5.lighter, h6.lighter, .navbar.lighter {
  font-weight: 200 !important;
}


/* ---------- */


/* ANIMATIONS */


/* ---------- */

.animated .small, .animated .medium, .animated .large {
  opacity: 0;
  -webkit-transition-property: all;
  transition-property: all;
}

.animated .large {
  -webkit-transition-delay: 1s;
          transition-delay: 1s;
  -webkit-transition-duration: 1s;
          transition-duration: 1s;
}

.animated .medium {
  -webkit-transition-delay: 1.35s;
          transition-delay: 1.35s;
  -webkit-transition-duration: 0.75s;
          transition-duration: 0.75s;
}

.animated .small {
  -webkit-transition-delay: 1.5s;
          transition-delay: 1.5s;
  -webkit-transition-duration: 0.5s;
          transition-duration: 0.5s;
}

.animated.from-bottom .small, .animated.from-bottom .medium, .animated.from-bottom .large {
  opacity: 1;
  -webkit-transform: translateY(100%);
          transform: translateY(100%);
}

.animated.from-top .small, .animated.from-top .medium, .animated.from-top .large {
  opacity: 1;
  -webkit-transform: translateY(-100%);
          transform: translateY(-100%);
}

.animated.animation-on .small, .animated.animation-on .medium, .animated.animation-on .large {
  -webkit-transform: translateY(0%);
          transform: translateY(0%);
}


